// 1. R√©cup√©rer la liste des projets (M√©tadonn√©es)
const repoMetadata = $('Scraping Github').all(); 

// 2. R√©cup√©rer le contenu des Readme (Donn√©es actuelles)
const readmeData = $('Extracting Readme').all();

// 3. Fusionner les deux
const summary = repoMetadata.map((repo, index) => {
  const meta = repo.json;

  // Par d√©faut : Pas de readme
  let content = "Pas de README disponible.";

  // CORRECTION ICI : On v√©rifie simplement si la donn√©e 'readme_content' existe.
  // Plus besoin de v√©rifier .error explicitement, ce qui supprime le soulignement rouge.
  if (readmeData[index] && readmeData[index].json && readmeData[index].json.readme_content) {

     // On prend 1000 caract√®res pour avoir la stack technique
     content = readmeData[index].json.readme_content.substring(0, 1000) + "..."; 
  }

  return {
    name: meta.name,
    // On ajoute la description GitHub (tr√®s utile pour l'IA)
    description: meta.description || "Pas de description",
    language: meta.language || "Non sp√©cifi√©",
    updated_at: meta.updated_at.split('T')[0], // Date propre (YYYY-MM-DD)
    readme_excerpt: content // L'extrait du readme
  };
});

// 4. Renvoyer le paquet propre
return {
  json: {
    github_summary: summary
  }
};
